import Header from "../components/Header"
import Footer from "../components/Footer"
import ContactForm from "../components/ContactForm"

export default function() {
    return (
        <>
            <Header />
            <h2>Contact Page</h2>
            <ContactForm />
            <Footer />
        </>
    )
}
